        padding: em(26px);
        .mm__carousel-minify-handler {
            .i-minimize {
                transform: rotate(180deg);
            }
        }
    }


    &-items-counter {
        font-family: $font-family-base;
        font-size: em(15px);
        background: #ede7e7;
        border-radius: 150px;
        padding: 0.4em 1.4em;
    }

    &-minify-handler {
        float: right;
    }

    &-title {
        display: grid;
        grid-template-columns: auto auto 1fr;
        column-gap: em(20px);
        align-items: center;


    }

    &-reorder {
        // display: none;
        overflow: hidden;
        margin: em(30px) 0;
        font-family: $font-family-base;
        font-size: em(14px);
        line-height: 1.2em;
    }

    &-card {
        position: relative;
        cursor: move;

        span {
            background: $mm-card-selected;
            color: white;
            box-shadow: 0 2px 11px 0 rgba(0,0,0,0.25);
            position: absolute;
            display: inline-flex;
            align-items: center;
            height: 24px;
            padding: 4px 12px;
            border-radius: em(150px);
            font-family: $font-family-base;
            font-size: em(12px);
            top: -1em;
            right: -1em;
            font-weight: 900;

        }
    }

